// üëã
const enter = 'data:image/png;base64,'

// ‚ö†Ô∏è
const warning = 'data:image/png;base64,'

// ‚ùå
const error = 'data:image/png;base64,'

// üí¨
const type = 'data:image/png;base64,'

// üëâ
const press = 'data:image/png;base64,'

// üëÜ
const swipe = 'data:image/png;base64,'

// üîô
const goback = 'data:image/png;base64,'

// üîò
const select = 'data:image/png;base64,'

// üíæ
const save = 'data:image/png;base64,'

// üì∫
const video = 'data:image/png;base64,'

// üîé
const search = 'data:image/png;base64,'

// üìÑ
const page = 'data:image/png;base64,'

// üö™
const leave = 'data:image/png;base64,'

// üí§
const standby = 'data:image/png;base64,'

// üí≥
const pay = 'data:image/png;base64,'

// ‚®ê
const _function = 'data:image/png;base64,'

// üîó
const link = 'data:image/png;base64,'

// ‚¨áÔ∏è
const download = 'data:image/png;base64,'

// ‚öôÔ∏è
const setting = 'data:image/png;base64,'

// üóëÔ∏è
const _delete = 'data:image/png;base64,'

// ‚≠êÔ∏è
const update = 'data:image/png;base64,'

// ‚ú®
const create = 'data:image/png;base64,'

let observer = new MutationObserver(mutations => {
  for (let mutation of mutations) {
    for (let addedNode of mutation.addedNodes) {
      const isFunction = typeof addedNode.getElementsByTagName === 'function'
      if (isFunction) {
        const images = addedNode.getElementsByTagName('img')
        for (let i = 0; i < images.length; i++) {
          const title = images[i].title
          if (images[i].src.includes('plugins/Morpheus/images/action.svg')) {
            if (title.includes('App / start') || title.includes(':enter:')) {
              images[i].src = enter
            } else {
              images[i].src = page
            }
          } else if (images[i].src.includes('plugins/Morpheus/images/event.svg')) {
            if (title.includes(':enter:')) {
              images[i].src = enter
            } else if (title.includes(':warning:')) {
              images[i].src = warning
            } else if (title.includes(':error:')) {
              images[i].src = error
            } else if (title.includes(':type:')) {
              images[i].src = type
            } else if (title.includes(':press:')) {
              images[i].src = press
            } else if (title.includes(':swipe:')) {
              images[i].src = swipe
            } else if (title.includes(':goback:') || title.includes('Go back')) {
              images[i].src = goback
            } else if (title.includes(':select:')) {
              images[i].src = select
            } else if (title.includes(':save:')) {
              images[i].src = save
            } else if (title.includes(':video:')) {
              images[i].src = video
            } else if (title.includes(':search:')) {
              images[i].src = search
            } else if (title.includes(':page:')) {
              images[i].src = page
            } else if (title.includes(':leave:')) {
              images[i].src = leave
            } else if (title.includes(':standby:')) {
              images[i].src = standby
            } else if (title.includes(':pay:')) {
              images[i].src = pay
            } else if (title.includes(':function:')) {
              images[i].src = _function
            } else if (title.includes(':link:')) {
              images[i].src = link
            } else if (title.includes(':download:')) {
              images[i].src = download
            } else if (title.includes(':setting:')) {
              images[i].src = setting
            } else if (title.includes(':delete:')) {
              images[i].src = _delete
            } else if (title.includes(':update:')) {
              images[i].src = update
            } else if (title.includes(':create:')) {
              images[i].src = create
            } else {
              images[i].src = update
            }
          }
        }
      }
    }
  }
})

observer.observe(document, { childList: true, subtree: true })
